// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.4.22 <0.9.0;

// This import is automatically injected by Remix
import "remix_tests.sol"; 
import "../contracts/_ChunkManager.sol";

contract ChunkManagerTest {
    // Instance of ChunkManager
    ChunkManager chunkManager;

    // Runs before all tests
    function beforeAll() public {
        // Create an instance of ChunkManager
        chunkManager = new ChunkManager();
    }

    event logNumber (uint256);


    // Test chunking functionality
    function testChunkContent() public {
        string memory content = "Testing content. AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA";
        string[] memory chunks = chunkManager.chunkContent(content);
        uint256 numberOfChunks = chunks.length;
        emit logNumber(numberOfChunks);


        Assert.equal(chunks.length, 1, "incorrect");


        // Assert the content of each chunk
        Assert.equal(chunks[0], "This is a test content.", "Incorrect content in the first chunk");
    }

    // Test concatenation functionality
    function testConcatenateChunks() public {
        string[] memory chunks = new string[](2);
        chunks[0] = "This is ";
        chunks[1] = "a test.";

        string memory concatenatedContent = chunkManager.concatenateChunks(chunks);

        // Assert the concatenated content
        Assert.equal(concatenatedContent, "This is a test.", "Incorrect concatenated content");
    }
}

contracts/_ChunkManager.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

contract ChunkManager {
   function chunkContent(string memory content) public pure returns (string[] memory) {                           //Changed to public for testing
        uint256 chunkSize = 32;
        uint256 numChunks = (bytes(content).length + chunkSize - 1) / chunkSize;
        string[] memory chunks = new string[](numChunks);

        for (uint256 i = 0; i < numChunks; i++) {
            uint256 start = i * chunkSize;
            uint256 end = start + chunkSize;
            if (end > bytes(content).length) {
                end = bytes(content).length;
            }
            bytes memory chunkBytes = new bytes(end - start);
            for (uint256 j = start; j < end; j++) {
                chunkBytes[j - start] = bytes(content)[j];
            }
            chunks[i] = string(chunkBytes);
        }

        return chunks;
    }

    function concatenateChunks(string[] memory chunks) public pure returns (string memory) {                              //Changed to public for testing
        uint256 totalLength = 0;
        for (uint256 i = 0; i < chunks.length; i++) {
            totalLength += bytes(chunks[i]).length;
        }

        bytes memory result = new bytes(totalLength);
        uint256 currentIndex = 0;

        for (uint256 i = 0; i < chunks.length; i++) {
            bytes memory chunkBytes = bytes(chunks[i]);
            for (uint256 j = 0; j < chunkBytes.length; j++) {
                result[currentIndex++] = chunkBytes[j];
            }
        }

        return string(result);
    }
}

